	assign  BR     = 7'b1100011;
    assign  JALR    = 7'b1100111;
    assign  SB      = 7'b1100011;
    assign  LUI     = 7'b0110111;
    assign  AUIPC   = 7'b0010111;
    assign  JAL     = 7'b1101111;

7'b0000011 /*I-type load*/     : 
            Imm_out = {inst_code[31]? 20'b1:20'b0 , inst_code[31:20]}; //if inst_code[31] = 1 then  
        7'b0010011 /*I-type addi*/     : 
            Imm_out = {inst_code[31]? 20'b1:20'b0 , inst_code[31:20]};
        7'b1100111 /*JALR - Itype output?*/      :
            Imm_out = {inst_code[31], 20'b1:20'b0 , inst_code[31:20]};        
        7'b0100011 /*S-type*/    : 
            Imm_out = {inst_code[31]? 20'b1:20'b0 , inst_code[31:25], inst_code[11:7]}; //{} means concate
        7'b1100011 /*B-type*/   :
            Imm_out = {inst_code[31]? 19'b1:19'b0 , inst_code[7], inst_code[30:25], inst_code[11:8], 1b'0};
        7'b0110111 /*LUI/UTYPE*/      :
            Imm_out = {inst_code[31:12], 12'b0};
        7'b0010111 /*AUIPC/UTYPE*/      :
            Imm_out = {inst_code[31:12], 12'b0};
        7'b1101111 /*J-Type*/      :
            Imm_out = {inst_code[31]? 11'b1:11'b0, inst_code[19:12], inst_code[20], inst_code[30:25], inst_code[24:21], 1b'0};

#include <SoftwareSerial.h>// import the serial library

SoftwareSerial Genotronex(10, 11); // RX, TX
//int ledpin=13; // led on D13 will show blink on / off
int BluetoothData; // the data given from Computer
const int motorPin = 9;
int speed = 0;
int press = 1;

void setup() {
  // put your setup code here, to run once:
  Genotronex.begin(9600);
//  Genotronex.println("Bluetooth On please press 1 or 0 blink LED ..");
  pinMode(motorPin, OUTPUT);
}

void loop() {
   if (Genotronex.available()){
      BluetoothData=Genotronex.read();
      if(BluetoothData=='1'){   
         Genotronex.println("Driving Forward ^.^");
         digitalWrite(motorPin, HIGH);
         delay(2000);
         digitalWrite(motorPin, 0);
     }

    if (BluetoothData=='0'){
         digitalWrite(motorPin, 0);
         Genotronex.println("Stopping");
    }
}
delay(100);
}
